import{_ as o,c as t,o as s,ag as i}from"./chunks/framework.BDwTZuFy.js";const p=JSON.parse('{"title":"Troubleshooting Guide üõ†Ô∏è","description":"","frontmatter":{},"headers":[],"relativePath":"tubs-statusplugin/latest/troubleshooting.md","filePath":"tubs-statusplugin/latest/troubleshooting.md"}'),r={name:"tubs-statusplugin/latest/troubleshooting.md"};function l(a,e,n,u,c,d){return s(),t("div",null,e[0]||(e[0]=[i('<h1 id="troubleshooting-guide-üõ†Ô∏è" tabindex="-1">Troubleshooting Guide üõ†Ô∏è <a class="header-anchor" href="#troubleshooting-guide-üõ†Ô∏è" aria-label="Permalink to &quot;Troubleshooting Guide üõ†Ô∏è&quot;">‚Äã</a></h1><p>Experiencing issues with Tub&#39;s Status Plugin? This guide will help you diagnose and resolve them.</p><h2 id="_1-initial-checks-‚úÖ" tabindex="-1">1. Initial Checks ‚úÖ <a class="header-anchor" href="#_1-initial-checks-‚úÖ" aria-label="Permalink to &quot;1. Initial Checks ‚úÖ&quot;">‚Äã</a></h2><ul><li><strong>Latest Plugin Version:</strong> Ensure you&#39;re using the most recent version of Tub&#39;s Status Plugin from <a href="https://modrinth.com/plugin/tubs-status-plugin" target="_blank" rel="noreferrer">Modrinth</a>.</li><li><strong>Server Version:</strong> The plugin targets API 1.13+ (compatible up to 1.21+). Verify your server (Spigot, Paper, etc.) is within this range.</li><li><strong>Java Version:</strong> The plugin is built with Java 14, targeting Java 8 runtime. Ensure your server runs Java 8 or a compatible newer version.</li><li><strong>Console Logs:</strong> Your primary tool! Check <code>logs/latest.log</code> for errors or warnings from <code>[TSP]</code> or <code>TubsStatusPlugin</code> during startup or when the issue occurs. <ul><li>Set <code>loggerLevel: 10</code> (DEBUG) in <code>config.yml</code> for maximum detail during troubleshooting.</li></ul></li><li><strong><code>config.yml</code>:</strong> Review <code>plugins/TubsStatusPlugin/config.yml</code> for typos, correct values, and valid YAML syntax (use an online YAML validator).</li><li><strong>Dependencies:</strong><ul><li>If using PlaceholderAPI features, is PlaceholderAPI installed, enabled, and up-to-date?</li><li>If using LuckPerms prefix/suffix features, is LuckPerms installed, enabled, and up-to-date?</li></ul></li></ul><h2 id="_2-common-issues-solutions" tabindex="-1">2. Common Issues &amp; Solutions <a class="header-anchor" href="#_2-common-issues-solutions" aria-label="Permalink to &quot;2. Common Issues &amp; Solutions&quot;">‚Äã</a></h2><h3 id="a-status-not-setting-or-displaying" tabindex="-1">A. Status Not Setting or Displaying <a class="header-anchor" href="#a-status-not-setting-or-displaying" aria-label="Permalink to &quot;A. Status Not Setting or Displaying&quot;">‚Äã</a></h3><details class="details custom-block"><summary>Symptoms &amp; Checklist</summary><p><strong>Symptoms:</strong></p><ul><li><code>/status &lt;message&gt;</code> or <code>/status &lt;groupname&gt;</code> command seems to work (no error), but the status doesn&#39;t appear in tab, above head, or in chat.</li><li>Status appears in some places but not others.</li></ul><p><strong>Checklist:</strong></p><ol><li><strong>Permissions:</strong><ul><li>Does the player have <code>StatusPlugin.setStatus</code> (for custom status) or <code>StatusPlugin.group.set</code> (for group status)?</li><li>If using color/formatting codes, do they have the relevant <code>StatusPlugin.formatting.&lt;type&gt;</code> permissions (e.g., <code>StatusPlugin.formatting.color</code>)? By default, these are OP-only.</li><li>For group statuses, check specific group permissions as outlined in the <a href="./configuration.html#statusgroups">Configuration Guide</a>.</li></ul></li><li><strong><code>config.yml</code> Settings:</strong><ul><li>Is <code>changeTablistNames: true</code> if you expect it in the tab list?</li><li>Is <code>chatFormatter: true</code> if you expect it in chat?</li></ul></li><li><strong><code>maxStatusLength</code>:</strong> Is the <em>visible</em> part of the status (after removing color codes/placeholders) within the configured <code>maxStatusLength</code>?</li><li><strong>Spaces in Status:</strong> If your status needs spaces, did you use <code>&amp;_</code> in the command? E.g., <code>/status Hello&amp;_World</code>. Regular spaces might be trimmed.</li><li><strong>Plugin Conflicts (Display):</strong><ul><li>Do you have other plugins that manage tab list formatting, player display names, or chat formatting with high priority? They might be overriding Tub&#39;s Status Plugin.</li><li>Try temporarily removing other such plugins to test.</li></ul></li><li><strong>Console Errors:</strong> Check for any errors when the status is set or when a player joins/chats.</li><li><strong>PlaceholderAPI/LuckPerms Hooks:</strong><ul><li>If using PAPI/LP placeholders in status: Are PAPI/LP installed and working? Does the player have <code>StatusPlugin.placeholders</code> permission?</li><li>Check startup logs to see if Tub&#39;s Status Plugin successfully hooked into PAPI/LP (&quot;Tub&#39;s StatusPlugin will now use PlaceholderAPI&quot;, &quot;Tub&#39;s StatusPlugin will now hook into LuckPerms&quot;).</li></ul></li></ol></details><h3 id="b-group-mode-issues" tabindex="-1">B. Group Mode Issues <a class="header-anchor" href="#b-group-mode-issues" aria-label="Permalink to &quot;B. Group Mode Issues&quot;">‚Äã</a></h3><details class="details custom-block"><summary>Symptoms &amp; Checklist</summary><p><strong>Symptoms:</strong></p><ul><li>Players can still set custom statuses with <code>/status &lt;message&gt;</code> even if <code>groupMode: true</code>. (Admins with <code>StatusPlugin.admin.setStatus</code> can always do this).</li><li><code>/status &lt;groupname&gt;</code> command doesn&#39;t work or says &quot;Invalid group name.&quot;</li><li>Players can&#39;t use a specific group status.</li></ul><p><strong>Checklist:</strong></p><ol><li><strong><code>groupMode: true</code>:</strong> Is this correctly set in <code>config.yml</code> and the plugin reloaded (<code>/tsp reload</code>) or server restarted?</li><li><strong><code>statusGroups</code> Definition (<code>config.yml</code>):</strong><ul><li>Are your groups defined correctly under <code>statusGroups:</code> with a <code>status:</code> sub-key?</li><li>Is the <code>&lt;groupname&gt;</code> used in the command an exact match (case-sensitive) to a key in <code>statusGroups</code>?</li></ul></li><li><strong>Permissions for Groups:</strong><ul><li>Does the player have the base <code>StatusPlugin.group.set</code> permission (default: true)?</li><li>For the specific group: <ul><li>If the group has a non-empty <code>permissions</code> list in <code>config.yml</code>, does the player have <strong>one</strong> of those permissions?</li><li>If the group&#39;s <code>permissions</code> list is empty or absent, <code>StatusPlugin.group.set</code> is generally sufficient.</li></ul></li><li>Refer to the detailed permission logic in the <a href="./configuration.html#statusgroups">Configuration Guide</a>.</li></ul></li><li><strong>Admin Commands:</strong> Remember admins can bypass player-facing group mode restrictions. <ul><li><code>/tsp setstatus &lt;player&gt; &lt;custom_message&gt;</code> will set a custom status.</li><li><code>/tsp setstatus &lt;player&gt; &lt;groupname&gt;</code> or <code>/status &lt;player&gt; &lt;groupname&gt;</code> will set a group status for another player.</li></ul></li></ol></details><h3 id="c-placeholderapi-placeholders-not-working" tabindex="-1">C. PlaceholderAPI Placeholders Not Working <a class="header-anchor" href="#c-placeholderapi-placeholders-not-working" aria-label="Permalink to &quot;C. PlaceholderAPI Placeholders Not Working&quot;">‚Äã</a></h3><details class="details custom-block"><summary>Symptoms &amp; Checklist</summary><p><strong>Symptoms:</strong></p><ul><li>Placeholders like <code>%tubsstatusplugin_status%</code> show as raw text.</li><li>Placeholders used <em>within</em> a status (e.g., <code>%player_name%</code>) are not parsed.</li></ul><p><strong>Checklist:</strong></p><ol><li><strong>PlaceholderAPI Installed &amp; Enabled:</strong> Is PAPI actually on your server and running? Check <code>/plugins</code>.</li><li><strong>Expansion Registered:</strong> Did Tub&#39;s Status Plugin successfully register its expansion? Check startup logs for &quot;Tub&#39;s StatusPlugin will now use PlaceholderAPI&quot;. Run <code>/papi info tubsstatusplugin</code> (or similar, check PAPI docs for listing expansions).</li><li><strong>Correct Placeholder Syntax:</strong><ul><li>For placeholders <em>provided by this plugin</em>: <code>%tubsstatusplugin_status%</code> or <code>%tubsstatusplugin_status_PlayerName%</code>.</li><li>For using <em>other PAPI placeholders in a status</em>: Ensure the placeholder itself is valid (e.g., <code>%vault_eco_balance%</code>) and the originating plugin is working.</li></ul></li><li><strong><code>StatusPlugin.placeholders</code> Permission:</strong> Does the player whose status contains PAPI placeholders (or the player for whom <code>%tubsstatusplugin_status%</code> is being parsed, though less likely an issue for the latter) have this permission?</li></ol></details><h3 id="d-luckperms-prefix-suffix-not-appearing-in-status" tabindex="-1">D. LuckPerms Prefix/Suffix Not Appearing in Status <a class="header-anchor" href="#d-luckperms-prefix-suffix-not-appearing-in-status" aria-label="Permalink to &quot;D. LuckPerms Prefix/Suffix Not Appearing in Status&quot;">‚Äã</a></h3><details class="details custom-block"><summary>Symptoms &amp; Checklist</summary><p><strong>Symptoms:</strong></p><ul><li><code>%LP_prefix%</code> or <code>%LP_suffix%</code> in a status message shows as raw text.</li></ul><p><strong>Checklist:</strong></p><ol><li><strong>LuckPerms Installed &amp; Enabled:</strong> Is LuckPerms on your server and functioning?</li><li><strong><code>StatusPlugin.placeholders</code> Permission:</strong> The player setting the status needs this permission.</li><li><strong>Correct Placeholder Strings:</strong> Ensure you are using exactly <code>%LP_prefix%</code> and <code>%LP_suffix%</code>.</li><li><strong>Prefix/Suffix Existence:</strong> Does the player actually <em>have</em> a prefix and/or suffix set in LuckPerms?</li><li><strong>Plugin Hook:</strong> Check startup logs for &quot;Tub&#39;s StatusPlugin will now hook into LuckPerms&quot;.</li></ol></details><h3 id="e-plugin-not-loading-errors-on-startup" tabindex="-1">E. Plugin Not Loading / Errors on Startup <a class="header-anchor" href="#e-plugin-not-loading-errors-on-startup" aria-label="Permalink to &quot;E. Plugin Not Loading / Errors on Startup&quot;">‚Äã</a></h3><details class="details custom-block"><summary>Symptoms &amp; Checklist</summary><p><strong>Symptoms:</strong></p><ul><li>Tub&#39;s Status Plugin not in <code>/plugins</code> list.</li><li>Errors related to <code>de.tubyoub.statusplugin</code> in console during server startup.</li></ul><p><strong>Checklist:</strong></p><ol><li><strong>Java Version:</strong> Ensure your server runs Java 8 or a compatible newer version.</li><li><strong>Server API Version:</strong> <code>plugin.yml</code> states <code>api-version: 1.13</code>. Ensure your server software is 1.13+.</li><li><strong>Corrupted JAR:</strong> Try re-downloading the plugin JAR.</li><li><strong>Dependencies in <code>plugins</code> folder:</strong> If soft dependencies like PlaceholderAPI or LuckPerms are intended to be used, ensure their JARs are also in the <code>plugins</code> folder.</li><li><strong><code>config.yml</code> Syntax (Severe):</strong> A completely broken <code>config.yml</code> could prevent loading. Back it up, delete it, and let the plugin regenerate a default one to test.</li></ol></details><h2 id="_3-providing-information-for-support-üÜò" tabindex="-1">3. Providing Information for Support üÜò <a class="header-anchor" href="#_3-providing-information-for-support-üÜò" aria-label="Permalink to &quot;3. Providing Information for Support üÜò&quot;">‚Äã</a></h2><p>If you&#39;re still facing issues, please join our <a href="https://discord.pluginz.dev" target="_blank" rel="noreferrer">community discord</a> for assistance!</p><p>To help us help you, please provide:</p><ul><li><strong>Tub&#39;s Status Plugin Version:</strong> (e.g., <code>1.6</code>)</li><li><strong>Server Software &amp; Version:</strong> (e.g., Paper 1.20.1, Spigot 1.19.4)</li><li><strong>Java Version:</strong> (Output of <code>java -version</code> from your server&#39;s environment)</li><li><strong>List of other plugins:</strong> (Output of <code>/plugins</code>)</li><li><strong>Your <code>config.yml</code> for Tub&#39;s Status Plugin.</strong> (Use a service like <a href="https://pastebin.com/" target="_blank" rel="noreferrer">Pastebin</a>)</li><li><strong>Relevant Console Logs:</strong> With errors or relevant messages, especially with <code>loggerLevel: 10</code>. (Use <a href="https://mclo.gs/" target="_blank" rel="noreferrer">mclo.gs</a> for long logs).</li><li><strong>Clear Description of the Issue:</strong> What you expect vs. what happens.</li><li><strong>Steps to Reproduce the issue.</strong></li></ul><p>The more details, the better!</p>',20)]))}const h=o(r,[["render",l]]);export{p as __pageData,h as default};
